import styled from "styled-components";

function Card({ url }) {
  return (
    <StyledWrapper>
      <div className="top">Saved</div>
      <div className="bottom">
        <span className="icon"><i className="fa-solid fa-circle-play"></i></span>
        <span className="showName">{url}</span>
      </div>
    </StyledWrapper>
  );
}

const StyledWrapper = styled.div`
  width: 100%;
  height: 100%;
  background: var(--secondarybg-dark);
  background-size: var(--secondarybg-dark-size);
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;

  div {
    font-size: 20px;
    margin: 3px;
    width: 100%;
    border: solid thin #fe4a49;
    flex-grow: 1;
    display: flex;
    align-items: center;
    justify-content: center;
    text-align: center;
    color: white;
  }
`;

export default Card;
